CREATE TABLE "Artist" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"Name" varchar(120)
)
GO
CREATE INDEX "IDXArtist_Id"
	ON "Artist" ("Id")
GO

CREATE TABLE "Album" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"Title" varchar(160) NOT NULL, 
	"ArtistId" integer NOT NULL, 
	FOREIGN KEY ("ArtistId")
		REFERENCES "Artist" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXAlbum_ArtistId"
	ON "Album" ("ArtistId")
GO
CREATE INDEX "IDXAlbum_Id"
	ON "Album" ("Id")
GO

CREATE TABLE "Employee" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"LastName" varchar(20) NOT NULL, 
	"FirstName" varchar(20) NOT NULL, 
	"Title" varchar(30), 
	"ReportsTo" integer, 
	"BirthDate" timestamp, 
	"HireDate" timestamp, 
	"Address" varchar(70), 
	"City" varchar(40), 
	"State" varchar(40), 
	"Country" varchar(40), 
	"PostalCode" varchar(10), 
	"Phone" varchar(24), 
	"Fax" varchar(24), 
	"Email" varchar(60), 
	FOREIGN KEY ("ReportsTo")
		REFERENCES "Employee" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXEmployee_Id"
	ON "Employee" ("Id")
GO
CREATE INDEX "IDXEmployee_ReportsTo"
	ON "Employee" ("ReportsTo")
GO

CREATE TABLE "Customer" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"FirstName" varchar(40) NOT NULL, 
	"LastName" varchar(20) NOT NULL, 
	"Company" varchar(80), 
	"Address" varchar(70), 
	"City" varchar(40), 
	"State" varchar(40), 
	"Country" varchar(40), 
	"PostalCode" varchar(10), 
	"Phone" varchar(24), 
	"Fax" varchar(24), 
	"Email" varchar(60) NOT NULL, 
	"SupportRepId" integer, 
	FOREIGN KEY ("SupportRepId")
		REFERENCES "Employee" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXCustomer_Id"
	ON "Customer" ("Id")
GO
CREATE INDEX "IDXCustomer_SupportRepId"
	ON "Customer" ("SupportRepId")
GO

CREATE TABLE "Genre" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"Name" varchar(120)
)
GO
CREATE INDEX "IDXGenre_Id"
	ON "Genre" ("Id")
GO

CREATE TABLE "Invoice" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"CustomerId" integer NOT NULL, 
	"InvoiceDate" timestamp NOT NULL, 
	"BillingAddress" varchar(70), 
	"BillingCity" varchar(40), 
	"BillingState" varchar(40), 
	"BillingCountry" varchar(40), 
	"BillingPostalCode" varchar(10), 
	"Total" decimal(10, 2) NOT NULL, 
	FOREIGN KEY ("CustomerId")
		REFERENCES "Customer" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXInvoice_CustomerId"
	ON "Invoice" ("CustomerId")
GO
CREATE INDEX "IDXInvoice_Id"
	ON "Invoice" ("Id")
GO

CREATE TABLE "MediaType" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"Name" varchar(120)
)
GO
CREATE INDEX "IDXMediaType_Id"
	ON "MediaType" ("Id")
GO

CREATE TABLE "Playlist" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"Name" varchar(120)
)
GO
CREATE INDEX "IDXPlaylist_Id"
	ON "Playlist" ("Id")
GO

CREATE TABLE "Track" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"Name" varchar(200) NOT NULL, 
	"AlbumId" integer, 
	"MediaTypeId" integer NOT NULL, 
	"GenreId" integer, 
	"Composer" varchar(220), 
	"Milliseconds" integer NOT NULL, 
	"Bytes" integer, 
	"UnitPrice" decimal(10, 2) NOT NULL, 
	FOREIGN KEY ("MediaTypeId")
		REFERENCES "MediaType" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION, 
	FOREIGN KEY ("GenreId")
		REFERENCES "Genre" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION, 
	FOREIGN KEY ("AlbumId")
		REFERENCES "Album" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXTrack_AlbumId"
	ON "Track" ("AlbumId")
GO
CREATE INDEX "IDXTrack_GenreId"
	ON "Track" ("GenreId")
GO
CREATE INDEX "IDXTrack_Id"
	ON "Track" ("Id")
GO
CREATE INDEX "IDXTrack_MediaTypeId"
	ON "Track" ("MediaTypeId")
GO

CREATE TABLE "InvoiceLine" (
	"Id" integer GENERATED BY DEFAULT AS IDENTITY PRIMARY KEY, 
	"InvoiceId" integer NOT NULL, 
	"TrackId" integer NOT NULL, 
	"UnitPrice" decimal(10, 2) NOT NULL, 
	"Quantity" integer NOT NULL, 
	FOREIGN KEY ("TrackId")
		REFERENCES "Track" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION, 
	FOREIGN KEY ("InvoiceId")
		REFERENCES "Invoice" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXInvoiceLine_Id"
	ON "InvoiceLine" ("Id")
GO
CREATE INDEX "IDXInvoiceLine_InvoiceId"
	ON "InvoiceLine" ("InvoiceId")
GO
CREATE INDEX "IDXInvoiceLine_TrackId"
	ON "InvoiceLine" ("TrackId")
GO

CREATE TABLE "PlaylistTrack" (
	"PlaylistId" integer NOT NULL, 
	"TrackId" integer NOT NULL,
	PRIMARY KEY ("PlaylistId", "TrackId"), 
	FOREIGN KEY ("PlaylistId")
		REFERENCES "Playlist" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION, 
	FOREIGN KEY ("TrackId")
		REFERENCES "Track" ("Id")
		ON UPDATE NO ACTION ON DELETE NO ACTION
)
GO
CREATE INDEX "IDXPlaylistTrack_PlaylistId"
	ON "PlaylistTrack" ("PlaylistId")
GO
CREATE INDEX "IDXPlaylistTrack_PlaylistId3"
	ON "PlaylistTrack" ("PlaylistId")
GO
CREATE INDEX "IDXPlaylistTrack_TrackId"
	ON "PlaylistTrack" ("TrackId")
GO

CREATE VIEW "AlbumWithArtistName" AS
SELECT a."Id", a."Title", a."ArtistId", ar."Name"
FROM "Album" a INNER JOIN "Artist" ar ON a."ArtistId" = ar."Id"

